import React from "react";
import imageBlog from "./assets/images/blogger-to-WordPress.jpeg";

function App() {
  return (
    <div className="App">
      <div className="box">
        <div className="content main">
          <h1>
            How To Migrate Blogger To WordPress: The Easiest Method In 2023
          </h1>
          <img src={imageBlog} alt="blog" width="840" height="350" />
        </div>
        <div className="content form"></div>
        <div className="content title"></div>
      </div>
    </div>
  );
}

export default App;
